import { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Routes,
  Route,
  Link
} from "react-router-dom";
//import Dashboard from "./dashboard";
import Login from "./login";
import Registration from "./registration";
import Navbar from '../components/navbar';
import NavigationBar from '../components/navigationbar';
import Description1 from '../components/homepage/description_1';
import Description2 from '../components/homepage/description_2';
import Description3 from '../components/homepage/description_3';
import Description4 from '../components/homepage/description_4';
import Description5 from '../components/homepage/description_5';
import Footer from '../components/homepage/footer';
import { 
    Container,
    Box
 } from '@chakra-ui/react';

const HomePage = () => {

    return (
        <Box
        bg="url('images/bg_0.png')"
        >
            <Box
            >
                <NavigationBar/>
            </Box>
            <Box
            >
                <Description1/>
            </Box>
            <Box>
                <Description2/>
            </Box>
            <Box>
                <Description3/>
            </Box>
            <Box>
                <Description4/>
            </Box>
            <Box>
                <Description5/>
            </Box>
            <Box>
                <Footer/>
            </Box>
        </Box>        
    );

};

const Home = () => {
  return (
    <div>
        <Router>
            <Routes>
                <Route path="/" element={<HomePage/>} />
                <Route path="/login" element={<Login/>} />
                <Route path="/signup" element={<Registration/>} />
            </Routes>
        </Router>
    </div>
  );
};

export default Home;
